INSERT INTO `news` VALUES (7,'Berita Seputar Ujian b','<div style=\"text-align:justify\"><img alt=\"\" src=\"http://unbk.kemdikbud.go.id/images/posts/Mendikbud.jpg\" style=\"height:121px; margin:2px; width:181px; float:left\" />(Dikutip dari <a href=\"http://unbk.kemdikbud.go.id/\" onclick=\"window.open(this.href, \'pop\', \'resizable=yes,status=no,location=no,toolbar=no,menubar=no,fullscreen=no,scrollbars=no,dependent=no,width=800,height=600\'); return false;\">http://unbk.kemdikbud.go.id/</a>) Ujian Nasional Berbasis Komputer (UNBK) disebut juga <em>Computer Based Test</em> (<em>CBT</em>) adalah sistem pelaksanaan ujian nasional dengan menggunakan komputer sebagai media ujiannya. Dalam pelaksanaannya, UNBK berbeda dengan sistem ujian nasional berbasis kertas atau <em>Paper Based Test</em> (<em>PBT</em>) yang selama ini sudah berjalan.\r\n\r\n<p><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\">Penyelenggaraan UNBK pertama kali dilaksanakan pada tahun 2014 secara online dan terbatas di SMP Indonesia Singapura dan SMP Indonesia Kuala Lumpur (SIKL). Hasil penyelenggaraan UNBK pada kedua sekolah tersebut cukup menggembirakan dan semakin mendorong untuk meningkatkan literasi siswa terhadap TIK (Teknologi Informasi dan Komunikasi). Selanjutnya secara bertahap pada tahun 2015 dilaksanakan rintisan UNBK dengan mengikutsertakan sebanyak 555 sekolah yang terdiri dari 42 SMP/MTs, 135 SMA/MA, dan 378 SMK di 29 Provinsi dan Luar Negeri.</span><br />\r\n<span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\">Penyelenggaraan UNBK saat ini menggunakan sistem </span><em>semi-online</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\"> yaitu soal dikirim dari </span><em>server</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\"> pusat secara </span><em>online</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\"> melalui jaringan (</span><em>sinkronisasi</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\">) ke </span><em>server</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\"> lokal (sekolah), kemudian ujian siswa dilayani oleh</span><em> server</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\"> lokal (sekolah) secara</span><em> offline</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\">. Selanjutnya hasil ujian dikirim kembali dari </span><em>server</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\"> lokal (sekolah) ke </span><em>server</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\"> pusat secara </span><em>online</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\"> (</span><em>upload</em><span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\">).</span></p>\r\n\r\n<hr />\r\n<p><strong>MOHON PERHATIAN</strong><br />\r\n<span style=\"font-family:helvetica neue,helvetica,arial,sans-serif\">Sehubungan dengan adanya laporan ke Kementerian Pendidikan dan Kebudayaan tentang pungutan yang dibebankan kepada orang tua dengan alasan untuk menyewa/membeli komputer untuk mengikuti Ujian Nasional Bebasis Komputer (UNBK), kami sampaikan hal sebagai berikut :</span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">UNBK hanya diselenggarakan pada sekolah yang sudah siap baik dari infrastruktur, SDM, maupun peserta. Infrastruktur sejauh mungkin memanfaatkan laboratorium komputer yang ada di sekolah.</li>\r\n	<li style=\"text-align:justify\">Sekolah calon penyelenggara UNBK pada tahun 2016 tidak diperkenankan untuk memaksakan diri membeli/menyewa komputer dengan membebani orang tua siswa.</li>\r\n	<li style=\"text-align:justify\">Bagi sekolah calon penyelenggara UNBK yang belum dapat memenuhi kecukupan infrastruktur dapat mengundurkan diri dari UNBK dan mengikuti UN berbasis Kertas dan Pensil (UNKP) dengan batas waktu pengunduran diri tanggal 15 Februari 2016</li>\r\n</ol>\r\n\r\n<p>Terima Kasih</p>\r\n\r\n\r\n</p>',184,0,'2016-02-17 19:51:20','2016-08-25 10:23:43'),(8,'VERIFIKASI SNMPTN','<p>Siswa kelas XII dimohon untuk segera melakukan verifikasi SNMPTN. Jika masih terjadi kesalahan nilai raport, mohon menghubungi:</p>\r\n\r\n<ul>\r\n	<li>Ibu Siti Mahmudah untuk kelas XII IPA 1 dan 2;</li>\r\n	<li>Bapak Teguh Yuwono untuk Kelas XII IPA 3, 4, dan 5;</li>\r\n	<li>Bapak M. Firdaus untuk Kelas XII IPA 6, 7, 8;</li>\r\n	<li>Bapak Adi Budiatmoko untuk kelas XII IPS 1, 2, dan 3</li>\r\n</ul>\r\n\r\n<p>Verifikasi terakhir Selasa, 20 Februari 2016.</p>\r\n\r\n<p>Terimakasih.</p>\r\n\r\n<p style=\"text-align: right;\">Tertanda,</p>\r\n\r\n<p style=\"text-align: right;\">Koordinator BK</p>\r\n\r\n<p style=\"text-align: right;\">Dra. Arianai Kristiani, Kons.</p>',184,0,'2016-02-18 17:23:42','2016-02-18 17:23:42'),(9,'Informasi Seputar PDSS','<h3><strong><span style=\"color:rgb(55, 62, 77); font-family:helvetica,arial,sans-serif; font-size:12px\">PENTING!!!</span></strong></h3>\r\n\r\n<blockquote>\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(55, 62, 77); font-family:helvetica,arial,sans-serif; font-size:12px\">Diinformasikan bahwa siswa-siswi kelas XII yang input nilai PDSS masih salah, dapat melakukan revisi paling lambat hari ini, SABTU, 20 FEBRUARI 2016 PUKUL 23.00 WIB. Silakan menghubungi petugas-petugas berikut untuk melakukan revisi: &bull; Ibu Siti Mahmudah untuk kelas XII IPA 1 dan 2; &bull; Bapak Teguh Yuwono untuk Kelas XII IPA 3, 4, dan 5; &bull; Bapak M. Firdaus untuk Kelas XII IPA 6, 7, 8; &bull; Bapak Adi Budiatmoko untuk kelas XII IPS 1, 2, dan 3. Sedangkan batas waktu verifikasi SNMPTN diundur sampai dengan tanggal 23 Februari 2016. Mohon diindahkan. Terimakasih.</span></p>\r\n</blockquote>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(55, 62, 77); font-family:helvetica,arial,sans-serif; font-size:12px\">Info seputar PDSS ada di&nbsp;<a href=\"http://sidomi.com/434944/jadwal-pdss-siswa-2016-paling-lambat-sabtu-jika-telat-siswa-tak-bisa-ikut-snmptn/\" style=\"color: rgb(7, 130, 193);\" target=\"_blank\">sini</a></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>',184,0,'2016-02-20 01:10:25','2016-02-20 01:18:49'),(10,'Berita Duka','<p>Innaa lillaahi wa innaa ilaihi rooji&#39;uun 3x</p>\r\n\r\n<p>Telah meninggal dunia dengan tenang Bapak <strong>Drs. Noto Busono</strong>, guru Ekonomi tadi pagi sebelum subuh. Semoga amal ibadah almarhum diterima di sisi Allah SWT, dan diampuni segal dosa beliau, aamiin ...</p>',184,0,'2016-02-28 16:27:42','2016-02-29 07:21:23'),(11,'Jadwal','<div style=\"text-align: center;\"><strong>JADWAL TRY OUT 3</strong></div>\r\n\r\n<div style=\"text-align: center;\"><strong>SMA NEGERI 1 DEMAK, 29 FEBRUARI - 5 MARET 2016</strong></div>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\">NO</th>\r\n			<th scope=\"col\">HARI</th>\r\n			<th scope=\"col\">MIPA</th>\r\n			<th scope=\"col\">IPS</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>1</td>\r\n			<td>SENIN, 29 FEBRUARI 2016</td>\r\n			<td>BAHASA INDONESIA</td>\r\n			<td>BAHASA INDONESIA</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2</td>\r\n			<td>SELASA, 1 MARET 2016</td>\r\n			<td>KIMIA</td>\r\n			<td>GEOGRAFI</td>\r\n		</tr>\r\n		<tr>\r\n			<td>3</td>\r\n			<td>RABU, 2 MARET 2016</td>\r\n			<td>MATEMATIKA</td>\r\n			<td>MATEMATIKA</td>\r\n		</tr>\r\n		<tr>\r\n			<td>4</td>\r\n			<td>KAMIS, 3 MARET 2016</td>\r\n			<td>BIOLOGI</td>\r\n			<td>SOSIOLOGI</td>\r\n		</tr>\r\n		<tr>\r\n			<td>5</td>\r\n			<td>JUMAT, 4 MARET 2016</td>\r\n			<td>FISIKA</td>\r\n			<td>EKONOMI</td>\r\n		</tr>\r\n		<tr>\r\n			<td>6</td>\r\n			<td>SABTU, 5 MARET 2016</td>\r\n			<td>BAHASA INGGRIS</td>\r\n			<td>BAHASA INGGRIS</td>\r\n		</tr>\r\n	</tbody>\r\n</table>',184,0,'2016-02-28 16:36:36','2016-02-29 07:18:33'),(12,'UJIAN SEKOLAH','<p><strong>JADWAL UJIAN SEKOLAH TA 2016/2016</strong></p>\r\n\r\n<table border=\