ai Pengumuman Hasil Kelulusan','<p><strong><u><img alt=\"\" src=\"/fileman/Uploads/yulia.mufarichah@gmail.com/pengum_UN_2.jpg\" style=\"height:1169px; width:850px\" /></u></strong></p>',184,0,'2016-04-23 13:10:52','2016-04-23 13:21:19'),(15,'HASIL SNMPTN','<p>HASIL SNMPTN TAHUN 2015/2016</p>\r\n\r\n<p>No Nama Kelas Jurusan Universitas<br />\r\n1. DEWI SUKMARATRI R XII IPA 1 MATEMATIKA UNDIP<br />\r\n2. ELMALINDA WIFA T XII IPA 1 TEHNIK ARSITEKTUR UNDIP<br />\r\n3. KARINA SEPTHA SARI XII IPA 1 TEHNIK SIPIL UNDIP<br />\r\n4. M. YUSAKA XII IPA 1 TEHNIK ELEKTRO UNDIP<br />\r\n5. NARISMA RIZKI A XII IPA 1 TEHNIK SIPIL UNDIP<br />\r\n6. PRAMESTI WIDYA K XII IPA 1 PENDIDIKAN DOKTER UNDIP<br />\r\n7. ADAM WAHYU SRI H XII IPA 2 TEHNIK SIPIL UNDIP<br />\r\n8. AGNES TESSYA S XII IPA 2 TEHIK INDUSTRI UNDIP<br />\r\n9. KHAIDHIR ALI H XII IPA 2 PJKR UNNES<br />\r\n10. AZARIA ZERLINA XII IPA 3 ILMU GIZI UNDIP<br />\r\n11. DEWI HENY AWALIA XII IPA 3 KESEHATAN MASYARAKAT UNDIP<br />\r\n12. EVA TRIYANI XII IPA 3 PGSD UNNES<br />\r\n13. IVA RIZKI AMALIA XII IPA 3 STATISTIKA UNDIP<br />\r\n14. KHOFIFATUL AZIZAH XII IPA 3 TEHNIK GEODESI UNDIP<br />\r\n15. PUTRI SILVIA XII IPA 3 PEND.DOKTER GIGI UNSOED<br />\r\n16. RESI DIANSISMITA XII IPA 3 TEHNIK GEODESI UNDIP<br />\r\n17. SATRIAWAN RASYID XII IPA 3 T.INFORMATIKA UNDIP<br />\r\n18. SHINTIA DWI P XII IPA 3 PEND.DOKTER GIGI UNJEM<br />\r\n19. NURUL IZATI XII IPA 4 TEHNIK INDUSTRI UNDIP<br />\r\n20. RESANTI ADITYANI XII IPA 4 BIOLOGI UNDIP<br />\r\n21. AHMAD ULIL ALBAB XII IPA 5 TEHNIK SIPIL&amp;LINGKUNGAN IPB<br />\r\n22. BAYU FAJAR N XII IPA 5 TEHNIK HASIL PERIKANAN UNDIP<br />\r\n23. KUKUH ALDI S XII IPA 5 TEHNIK SIPIL&amp;LINGKUNGAN IPB<br />\r\n24. M. SYAFIE XII IPA 5 MATEMATIKA UNDIP<br />\r\n25. NOVIA INDRI SUSANTI XII IPA 5 PEND. BAHASA INGGRIS UNV.TIDAR<br />\r\n26. OVI IMROATUL L XII IPA 5 ILMU KEPERAWATAN UNDIP<br />\r\n27. PRANIKA KUSUMA XII IPA 5 TEHNIK INFORMATIKA UNSOED<br />\r\n28. PUJI SIWI UTAMI XII IPA 5 PGSD UNNES<br />\r\n29. RANGGA WISNU S XII IPA 5 AGRIBISNIS UNSOED<br />\r\n30. ULFI NUR ALIFAH XII IPA 5 STATISTIKA UNDIP<br />\r\n31. ALFA SINTA NURUL XII IPA 6 MATEMATIKA IPB<br />\r\n32. ELOK MAULIDYA XII IPA 6 FARMASI UNSOED<br />\r\n33. FEBRIAN CANDRA XII IPA 6 BK UNNES<br />\r\n34. PUTRI ALIFA XII IPA 6 TEHNIK LINGKUGAN UNDIP<br />\r\n35. RINA NADLROTUL XII IPA 6 AGRIBISNIS IPB<br />\r\n36. SRI INDARTI XII IPA 6 PJKR UNNES<br />\r\n37. NISA AULIA P XII IPA 7 PEND.DOKTER UNDIP<br />\r\n38. SHERLY MUZIKHA Y XII IPA 7 ESEHATAN MASYARAKAT UNDIP<br />\r\n39. TITIK PUSPITA D XII IPA 7 PJKR UNNES<br />\r\n40. WAHYUNI CIKAL B XII IPA 7 AGRIBISNIS UNSOED<br />\r\n41. WINDA WIDYA P XII IPA 7 TEHNIK INDUSTRI UNDIP<br />\r\n42. IKE YUIANTI XII IPA 8 PSIKOLOGI UNDIP<br />\r\n43. INDAH DWI O XII IPA 8 PETERNAKAN UNDIP<br />\r\n44. RANI RAHMATUL M XII IPA 8 FARMASI UNSOED<br />\r\n45. REGYTA SASKIA P XII IPA 8 TEHNIK SIPIL UNNES<br />\r\n46. SYAHIBA THARQUL A XII IPA 8 ILMU KOMPUTER IPB<br />\r\n47. NOVIA PUTRI AMALIA XII IPS 1 MANAJEMEN UNDIP<br />\r\n48. ASTRI DHINDA MUTHIA XII IPS 1 PEND.EKONOMI AKUNTANSI UNNES<br />\r\n49. ATIK RAHMAWATI XII IPS 1 ILMU EKONOMI STUDI PEMB UNDIP<br />\r\n50. DEVITA DWI M XII IPS 1 PEMERINTAHAN UNDIP<br />\r\n51. DHIYA JIHAN XII IPS 1 PEMERINTAHAN UNDIP<br />\r\n52. RATNA CHOIRIAH XII IPS 1 AKUNTANSI UNDIP<br />\r\n53. RIZQI MAULANA M XII IPS 1 ILMU HUKUM UIN<br />\r\n54. AHMAD KHOIRUL XII IPS 2 ANTROPOLOGI SOSIAL UNDIP<br />\r\n55. BELLA RIZKY Y XII IPS 2 EKONOMI PEMBANGUNAN UNSOED<br />\r\n56. RR.TUTUT INDAH R XII IPS 2 ILMU ADM PUBLIK UNDIP<br />\r\n57. YENNI WAHYU T XII IPS 2 BAHASA INGRRIS UNNES<br />\r\n58. ANNISA HIDAYATI XII IPS 3 KOMUNIKASI UNDIP<br />\r\n59. AHMAT SAEFUL MUNIF XII IPS 3 EKONOMI ISLAM UNDIP<br />\r\n60. CARINA AYU P XII IPS 3 ILMU HUKUM UNDIP<br />\r\n61. FAUZY WALUYONO XII IPS 3 ILMU HUKUM UNDIP<br />\r\n62. IMELDA IDAMAYANTI XII IPS 3 SOSIOLOGI UGM<br />\r\n63. HANUM ALFIRA M XII IPS 3 ANTROPOLOGI SOSIAL UNDIP<br />\r\n64. KHISBATUL FAIZAH XII IPS 3 PEMERINTAHAN UNDIP</p>',184,0,'2016-05-31 08:53:58','2016-05-31 08:57:17'),(16,'Ujian Nasional Perbaikan','<div>\r\n<p>Ujian Nasional Perbaikan (UNP) akan diselenggarakan pada tanggal 29 Agustus 2016 s.d. 7 September 2016<br />\r\nPendaftaran akan dibuka mulai tanggal 1 Juni 2016 s.d. 16 Juli 2016.</p>\r\n\r\n<p>kunjungi laman http://unp.kemdikbud.go.id/</p>\r\n\r\n<p><img alt=\"\" src=\"/fileman/Uploads/yulia.mufarichah@gmail.com/UN_Perbaikan_2015.jpg\" style=\"height:227px; width:438px\" /></p>\r\n\r\n\r\n\r\n<div style=\"margin-left:auto; margin-right:auto; text-align:center\">\r\n<div style=\"margin-left:20px\">\r\n<h1> </h1>\r\n\r\n\r\n\r\n\r\n</p>\r\n</p>\r\n</p>',184,0,'2016-06-16 12:39:32','2016-06-16 12:43:45');
